import "../App.css";
import TodayInfo from "../Components/TodayInfo";
import Searchbar from "../Components/Searchbar";
import React from "react";

function Today(props) {
  return (
    <div className="today" style={props.background}>
      <TodayInfo
        weather={props.todayWeather.weather}
        temp={props.todayWeather.temp}
        logo={props.logo}
        unit={props.todayWeather.unit}
        graph={props.todayWeather.graph}
      />
      <Searchbar
        todayWeather={props.todayWeather}
        setTodayWeather={props.setTodayWeather}
        getWeather={props.getWeather}
      />
    </div>
  );
}

export default Today;
